function animate(e,t,n,o,a,i,l){if(e){var m=(new Date).getTime(),c=setInterval(function(){var u=Math.min(1,((new Date).getTime()-m)/i);l?e[t]=o+u*(a-o)+n:e.style[t]=o+u*(a-o)+n,1===u&&clearInterval(c)},25);l?e[t]=o+n:e.style[t]=o+n}}window.onload=function(){var e=document.getElementById("quiz-questions");e&&animate(document.scrollingElement||document.documentElement,"scrollTop","",0,e.offsetTop-350,1e3,!0)};